define({"topics" : [{"title":"Using Runtime Parameters","shortdesc":"\n               <p class=\"shortdesc\">Runtime parameters are parameters that you define in a pipeline and then call from         within that same pipeline. When\n                  the pipeline runs, the value replaces the name of the         runtime parameter. Use runtime parameters to define values for\n                  stage and pipeline         properties.\n               </p>\n            ","href":"datacollector\/UserGuide\/Pipeline_Configuration\/RuntimeValues.html#concept_rjh_ntz_qr","attributes": {"data-id":"concept_rjh_ntz_qr",},"menu": {"hasChildren":true,},"tocID":"concept_rjh_ntz_qr-d46e39985","next":"concept_rjh_ntz_qr-d46e39985",},{"title":"Using Runtime Properties","shortdesc":"\n               <p class=\"shortdesc\">Runtime properties are properties that you define in a file local to the <span class=\"ph\">Data Collector</span> and call from     within a pipeline. \n               </p>\n            ","href":"datacollector\/UserGuide\/Pipeline_Configuration\/RuntimeValues.html#concept_fjx_g31_1s","attributes": {"data-id":"concept_fjx_g31_1s",},"menu": {"hasChildren":true,},"tocID":"concept_fjx_g31_1s-d46e40459","next":"concept_fjx_g31_1s-d46e40459",},{"title":"Using Runtime Resources","shortdesc":"\n               <p class=\"shortdesc\">Similar to runtime properties, runtime resources are values that you define in a file         local to the <span class=\"ph\">Data Collector</span> and         call from within a pipeline. But with runtime resources, you can restrict the permissions         for the files\n                  to secure information. \n               </p>\n            ","href":"datacollector\/UserGuide\/Pipeline_Configuration\/RuntimeValues.html#concept_bs4_5nm_2s","attributes": {"data-id":"concept_bs4_5nm_2s",},"menu": {"hasChildren":true,},"tocID":"concept_bs4_5nm_2s-d46e40810","next":"concept_bs4_5nm_2s-d46e40810",}]});